        # –í—ã—á–∏—Å–ª—è–µ—Ç—Å—è ùêø = ùëò ‚àí 1, –≥–¥–µ k ‚Äì –∫–æ–ª–∏—á–µ—Å—Ç–≤–æ –Ω—É–ª–µ–π –≤ –ø–æ–ª—É—á–µ–Ω–Ω–æ–π –ø–æ—Å–ª–µ–¥–æ–≤–∞—Ç–µ–ª—å–Ω–æ—Å—Ç–∏ ùëÜ‚Ä≤.
        k = 0
        for i in sums:
            if i == 0:
                k += 1
        L = k - 1

        Y = []
        for i in range(-9, 0):
            s = 0
            for j in sums:
                if i == j:
                    s += 1
            y = abs(s - L) / sqrt(2 * L * (4 * abs(i) - 2))
            Y.append(y)

        for i in range(1, 10):
            s = 0
            for j in sums:
                if i == j:
                    s += 1
            y = abs(s - L) / sqrt(2 * L * (4 * abs(i) - 2))
            Y.append(y)

        success = True
        text = ""
        k = 1
        for i in Y:
            if i > 1.82138636:
                success = False
            text += f"Y{k}({i})\n"
            k += 1
            self.view_result.setPlainText(text)

        if success == True:
            text += "–¢–µ—Å—Ç –ø—Ä–æ–π–¥–µ–Ω"
        else:
            text += "–¢–µ—Å—Ç –Ω–µ –ø—Ä–æ–π–¥–µ–Ω"
        self.view_result.setPlainText(text)

